def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def all_left_truncatable_prime(numbers):
    x = numbers[41]
    primes = []
    for i in range(2, x):
        if '0' not in str(i):
            truncatable = True
            temp = str(i)
            while len(temp) > 1:
                temp = temp[1:]
                if not is_prime(int(temp)):
                    truncatable = False
                    break
            if truncatable:
                primes.append(i)
    return primes
